swap(T& a, T& b) { T tmp(a); // we've made a second copy of a a = b; // we've made a second copy of b (and discarded a copy of a) b = tmp; // we've made a second copy of tmp (and discarded a copy of b)
} 使用 std::move 改寫： template <class T>
swap(T& a, T& b) { T tmp(std::move(a)); a = std::move(b); b = std::move(tmp);
